019-10-07 15:17:14','2019-12-05 16:43:18'),(12,NULL,'DID Japan','<p>Компания Daido Kogyo (DID) основана в далеком 1933 году в&nbsp;Японий. С момента своего основания стремление Daido Kogyo к технологиям, создало высокопроизводительные и высококачественные продукты, отвечающие глобальному спросу на транспортировку. Подобного рода производство является результатом развития энтузиазма и человеческих ресурсов.</p>','<p>Приводная цепь&nbsp;DID&nbsp;является первой, кто успешно путешествует по Американскому континенту. Всемирно известный бренд DID является доказательством надежности и превосходной производительности при любых тяжелых условиях. Наши цепи мотоциклов и цепи автомобильных двигателей используются в более чем&nbsp;60 странах мира.</p>','RWVYi8WtmTrHceTyae.png',NULL,NULL,'did',NULL,NULL,NULL,1,11,1,'2019-10-07 15:17:25','2019-12-05 16:43:18'),(13,NULL,'ASHIMORI Malaysia',NULL,NULL,'vDjZ8nslYNDZVBxrlY.png',NULL,NULL,'ashimori-malaysia',NULL,NULL,NULL,0,12,1,'2019-11-26 06:39:33','2019-12-05 16:43:18'),(14,NULL,'SEIWA Japan',NULL,NULL,'8cowpaHKX60T1LAGTm.png',NULL,NULL,'seiwa-japan',NULL,NULL,NULL,0,13,1,'2019-11-26 06:40:08','2019-12-05 16:43:18'),(15,NULL,'TOKICO Japan',NULL,NULL,'HWej0AJO1hjG9dAN5u.png',NULL,NULL,'tokico-japan',NULL,NULL,NULL,0,14,1,'2019-11-26 06:40:27','2019-12-05 16:43:18'),(16,NULL,'YSK Taiwan',NULL,NULL,'J6u4ynncMU6Hdu74XI.png',NULL,NULL,'visa-china',NULL,NULL,NULL,0,15,1,'2019-11-26 06:40:50','2019-12-05 16:43:18'),(17,NULL,'TP Japan',NULL,NULL,'vrv5IfJ0zUrxOLlGgZ.png',NULL,NULL,'tp-japan',NULL,NULL,NULL,0,16,1,'2019-11-26 06:41:39','2019-12-05 16:43:18'),(18,NULL,'QJ Taiwan',NULL,NULL,'ju6TLN5H2Ho7a0Bgjd.png',NULL,NULL,'qj-taiwan',NULL,NULL,NULL,0,17,1,'2019-11-26 06:42:00','2019-12-05 16:43:18'),(19,NULL,'NOK Japan',NULL,NULL,'iuOQhiHaKIMBB609jX.png',NULL,NULL,'nok-japan',NULL,NULL,NULL,0,18,1,'2019-11-26 06:42:36','2019-12-05 16:43:18'),(20,NULL,'NPW Japan',NULL,NULL,'ryFS7147tik1JlIA5B.png',NULL,NULL,'npw-japan',NULL,NULL,NULL,0,19,1,